import { useState } from "react";


function Home() {

  const [count, setCount] = useState(0);

  return (
    <>
      <h1>this is home page</h1>
         <h1>{count}</h1>
         <button onClick={()=>setCount(count - 1)}>Decrement</button>
         <button onClick={()=>setCount(count + 1)}>Increment</button>
    </>
  );
}

export default Home;



function ComponentA() {
 
  return <div>
    <h1>Component A </h1>
  </div>;
}

